import { __decorate } from "tslib";
import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { LandingPageComponent } from './pages/components/landingPage/landing-page.component';
import { PageRoutingModule } from './page-routing.module';
import { MaterialModule } from './material/material.module';
import { DashboardService } from './pages/services/dashboard.service';
import { DashboardComponent } from './pages/components/dashboard/dashboard.component';
import { HttpClientModule } from '@angular/common/http';
import { ViewlistComponent } from './pages/components/dashboard/viewList/viewList.component';
let PageModule = class PageModule {
};
PageModule = __decorate([
    NgModule({
        declarations: [
            LandingPageComponent,
            DashboardComponent,
            ViewlistComponent
        ],
        imports: [
            CommonModule,
            PageRoutingModule,
            MaterialModule,
            HttpClientModule
        ],
        exports: [
            CommonModule,
            PageRoutingModule,
            MaterialModule,
        ],
        providers: [
            DashboardService,
        ]
    })
], PageModule);
export { PageModule };
